import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click the '+ New Event' button to navigate to the create page
    await page.waitForSelector('a.nav-link.create-btn'); // Wait for the button to be visible
    await page.click('a.nav-link.create-btn'); // Click the button
    await page.waitForLoadState('networkidle'); // Wait for the navigation to complete

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_navigation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_navigation.png'));

    // Verify navigation by checking the URL or page content
    const currentUrl = page.url();
    const isOnCreateEventPage = currentUrl.includes('create.html');

    return {
      success: isOnCreateEventPage,
      action: isOnCreateEventPage ? "Navigated to Create Event Page successfully" : "Failed to navigate to Create Event Page",
      extractedData: { currentUrl },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

